import BestMovies from './BestMovies';
import Map from './Map';
export default class App extends React.Component {

	render() {
		return (
			<div className="App">
				<Router>
				<Switch>
         		<Route path="/" component={BestMovies} />
         		<Route path="/map" component={Map} />
				</Switch>
       			</Router>
				{/* <Map/ > */}
			</div>
		);
	};
};
